};

equations{ 'f_dni_loss_des' } = define() {
	return ${csp.gss.sf.irr_loss_f3} +
			${csp.gss.sf.irr_loss_f2} +
			${csp.gss.sf.irr_loss_f1} +
			${csp.gss.sf.irr_loss_f0};
