equations{ 'sfhlT_coefs' } = define() {
	arr[3] = ${csp.gss.sf.ambt_loss_f3};
	arr[2] = ${csp.gss.sf.ambt_loss_f2};
	arr[1] = ${csp.gss.sf.ambt_loss_f1};
	arr[0] = ${csp.gss.sf.ambt_loss_f0};
	return arr;
