function sf_loss_adjustment_set() 
{
	if (financing() != "LCOE Calculator" && financing() != "None") {
		if (value('system_use_lifetime_output') == 1) {
			property('sf_adjust', 'AnalysisPeriod', value('analysis_period'));
		}
		else {
			property('sf_adjust', 'AnalysisPeriod', 1);
		}
	}
	else {
		property('sf_adjust', 'AnalysisPeriod', 1);
	}
}
